INSERT INTO `courses` (`id`, `category_id`, `parent_id`, `name`, `order`, `title`, `slug`, `hands_on`, `summary`, `about`, `learning`, `enroll`, `job_opp`, `thumnail`, `background`, `referance`, `duration`, `fee`, `status`, `special`, `created_at`, `updated_at`) VALUES
(1, 2, 0, 'Django', '55', 'Learn Django', 'django', 1, 'Django is a web application framework written in Python.', '<p>Django is a top-level Python Web framework helps swift development, clean and sensible design. It has the ability to ease the hassle of web development. Thus, many companies and websites are using this Python web framework because it performs brilliantly not only for the start-ups but also for the full-blown companies.</p>\r\n\r\n<p>That is why a student who has mastered Django can provide good value to these companies. Also, for a youngster who wants to shine on the biggest stages, Django can give him or her that opportunity quite easily because of the lack of candidates. For many, it is a dream to work for organizations such as Google, Instagram, Firefox, Spotify, and many others. After learning Django Python Web Framework from us, your dream will take that giant step towards becoming reality.</p>', '<ul>\r\n	<li>Front End - HTML, CSS, Bootstrap</li>\r\n	<li>Django Installation in a Development and Production Environment</li>\r\n	<li>Develop secure web sites with Django</li>\r\n	<li>Integration with Relational Databases</li>\r\n	<li>Django URLs</li>\r\n	<li>Django Views</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Django Templates and Models</li>\r\n	<li>Django Forms</li>\r\n	<li>Django Admin and Abstract model for authentication</li>\r\n	<li>CRUD Operations</li>\r\n	<li>Classy Views, Sending Email Services</li>\r\n	<li>Deployment of Websites using Heroku</li>\r\n</ul>', '<ul>\r\n	<li>Students with knowledge on Python and Engineering &amp; Arts Graduates who wants to get into website development field can take up the Django course.</li>\r\n	<li>Programmers</li>\r\n	<li>Developers</li>\r\n	<li>Technical Leads</li>\r\n	<li>Architects</li>\r\n	<li>Professionals</li>\r\n</ul>', '<p>A Software Developer earns an average salary of Rs 390,970 per year. Person with knowledge in Python Django will get employed in following designations.&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Python Django Developer</li>\r\n	<li>Full Stack Developer</li>\r\n	<li>Back End Developer</li>\r\n	<li>Software Engineer</li>\r\n	<li>Senior Software Engineer</li>\r\n</ul>', 'images/courses/1556434454thumnail.png', 'images/courses/1537772187background.jpg', 'images/courses/1537772187referance.jpg', '56.00', '15000.00', 0, 0, '2018-09-24 00:56:27', '2019-04-28 00:54:14'),
(2, 1, 0, 'Ethical Hacking', '25', 'Lay a strong foundation to identify the intricacies of Ethical Hacking', 'ethical-hacking', 1, 'Ethical Hacking is to improve the security of the network or systems by fixing the vulnerabilities found during testing.', '<p>Ethical Hacking is the process of breaking into an organization&#39;s IT networks and systems to test their weakness and vulnerabilities. There are five phases in hacking. They include reconnaissance, gaining access, enumeration, maintaining access, and covering tracks. Hackers use various hacking tools and techniques in each of these phases.</p>\r\n\r\n<p>Ethical hackers conduct vulnerability assessment, risk assessment, penetration testing and system protection tests and fix security issues before they are exploited by hackers with malicious intent.</p>', '<ul>\r\n	<li>Introduction to Ethical Hacking</li>\r\n	<li>Footprinting and Reconnaissance</li>\r\n	<li>Scanning Networks</li>\r\n	<li>Enumeration</li>\r\n	<li>Vulnerability Analysis</li>\r\n	<li>System Hacking</li>\r\n	<li>Malware Threats</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Sniffing</li>\r\n	<li>Social Engineering</li>\r\n	<li>Denial-of-Service</li>\r\n	<li>Session Hijacking</li>\r\n	<li>Hacking Web Servers</li>\r\n	<li>Hacking Web Applications</li>\r\n	<li>SQL Injection</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Hacking Wireless Networks</li>\r\n	<li>Hacking Mobile Platforms</li>\r\n	<li>IoT Hacking</li>\r\n	<li>Evading IDS, Firewalls &amp; Honeypot</li>\r\n	<li>Cloud Computing</li>\r\n	<li>Cryptography</li>\r\n</ul>', '<p>Graduates with basic computer skills and strong Knowledge in TCP/IP can benefit from the course and student/Professional concerned with secure programming and the integrity of the network infrastructure.</p>', '<ul>\r\n	<li>After the completion of this training one can aim at becoming</li>\r\n	<li>IT Security Specialist</li>\r\n	<li>IT Security Consultant</li>\r\n	<li>Penetration Tester</li>\r\n	<li>Computer Forensics Analyst</li>\r\n	<li>Intrusion Analyst</li>\r\n	<li>Infosec Analyst</li>\r\n	<li>Cyber Security Engineer</li>\r\n	<li>Computer Network Defense (CND) Analyst / Auditor</li>\r\n	<li>CND Infrastructure Support / Incident Responder</li>\r\n	<li>Businesses &amp; Hiring Managers</li>\r\n	<li>Homeland Security Specialist</li>\r\n	<li>IT Auditor</li>\r\n	<li>Site Administrator</li>\r\n</ul>', 'images/courses/1556437215thumnail.jpg', 'images/courses/1537784919background.png', 'images/courses/1537784919referance.jpg', '68.00', '20000.00', 1, 0, '2018-09-24 04:28:39', '2019-07-25 05:14:55'),
(3, 1, 0, 'Machine Learning', '60', 'Machine Learning', 'machine-learning', 1, 'Build Intelligent Applications. Master machine learning fundamentals from the experts.', '<p>What&#39;s the course about</p>\r\n\r\n<p>Machine Learning is a technique behind innovations such as facial recognition, self-driving cars, predictive results in search, Predictive text etc. It is playing a significant role in developing new algorithms which permits software application to predict/achieve accurate results without being explicitly programmed.</p>\r\n\r\n<p>Machine Learning is implemented where programming or developing an efficient algorithm is problematic or not feasible. Machine Learning is revolutionizing the computing ecosystem.</p>\r\n\r\n<p><strong>Course Objective</strong></p>\r\n\r\n<p>The objective of this training program is to understand how machines can learn from its past experience which is considered as the core of AI. We focus on creating strong fundamental knowledge sets on building algorithms by mastering the principles of statistical analysis.</p>', '<ol>\r\n	<li>Preliminaries of Statistics</li>\r\n	<li>Graphical Techniques/ Data Visualization</li>\r\n	<li>Data Mining &ndash; Supervised Learning\r\n	<ol>\r\n		<li>Regression\r\n		<ol>\r\n			<li>Simple Linear Regression</li>\r\n			<li>Multilinear Regression</li>\r\n			<li>Logistic Regression</li>\r\n		</ol>\r\n		</li>\r\n		<li>Decision Trees</li>\r\n		<li>Random Forest &ndash; Ensemble Model</li>\r\n		<li>K-Nearest Neighbour (KNN)</li>\r\n		<li>Support Vector Machine (SVM)</li>\r\n		<li>Neural Networks</li>\r\n		<li>Na&iuml;ve Bayes Classifier</li>\r\n	</ol>\r\n	</li>\r\n	<li>Data Mining &ndash; Unsupervised Learning\r\n	<ol>\r\n		<li>Clustering\r\n		<ol>\r\n			<li>Hierarchical Clustering</li>\r\n			<li>K-Means Clustering</li>\r\n			<li>K-Medoids</li>\r\n			<li>CLARA</li>\r\n			<li>DBSCAN</li>\r\n		</ol>\r\n		</li>\r\n		<li>Dimension Reduction</li>\r\n		<li>Principal Component Analysis</li>\r\n	</ol>\r\n	</li>\r\n</ol>', '<p>Graduates from Engineering, Computer science, Statistics, Economics, Management stream etc., who are looking at building their career in data science and Machine Learning. Programming Developers, Analytic Professionals, Information Architects, Business Analyst etc., will benefit from Machine Learning in harvesting deeper insights, especially from big data</p>', '<ul>\r\n	<li>Machine Learning Engineer</li>\r\n	<li>Data Scientist- Machine Learning/NLP</li>\r\n	<li>Data Engineer- Machine Learning</li>\r\n	<li>Architect</li>\r\n	<li>Natural Language Processing Engineer-Machine Learning</li>\r\n	<li>Machine Learning Software Engineer</li>\r\n	<li>Data Scientist-Advanced Analytics</li>\r\n	<li>Data Analyst-Machine Learning</li>\r\n	<li>Machine Learning Specialist</li>\r\n	<li>Lead Data Scientist</li>\r\n	<li>Machine Learning Developer</li>\r\n	<li>Engineer-Machine Learning</li>\r\n	<li>Artificial Intelligence Expert</li>\r\n	<li>Consultant</li>\r\n	<li>Research Engineer</li>\r\n	<li>Software Engineer-Machine Learning</li>\r\n	<li>Manager-Machine Learning &amp; Analysis</li>\r\n	<li>Research Scientist/Applied Research Scientist</li>\r\n	<li>Distributed Systems Engineer</li>\r\n	<li>Data Visualize</li>\r\n</ul>', 'images/courses/1571138666thumnail.jpg', 'images/courses/1537786441background.png', 'images/courses/1537786441referance.jpg', '96.00', '25000.00', 1, 0, '2018-09-24 04:54:01', '2019-10-15 18:24:26'),
(4, 2, 0, 'JAVA', '75', 'ADVANCED JAVA/J2EE', 'java', 1, 'Gain expertise in Java with the Advanced Java. Java at advanced level is used to connect network and server.', '<p>In present times, if you want a good job in this competitive market then you have to go to a sector where there are less competition and high demand. Knowing Advanced Java gives you that leverage of moving to a sector which is less crowded and high in demand. Many big companies are looking to hire programmers who are well-versed in Advanced Java programming.</p>\r\n\r\n<p>Advanced Java stands for the applications that run on servers which are web applications. There is a huge job opportunity for Java Programmers all over the world. Knowledge of advanced java is required in many technical sectors and various IT companies are paying very high to the individuals who are knowledgeable in Advanced Java.</p>\r\n\r\n<p>In this field of computer and internet networking, the job role of Java programmer is arguably one of the most lucrative. So, if you want to avail top-notch industry standard Advanced Java training, then without waiting further, get enrolled in our course.</p>', '<ul>\r\n	<li>SQL and JDBC</li>\r\n	<li>HTML(Hypertext Markup Language)</li>\r\n	<li>XML(Extensible Markup Language)</li>\r\n	<li>Servlets</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>JSP(JavaServer Pages)</li>\r\n	<li>JavaScript</li>\r\n	<li>EJB(Enterprise JavaBeans)</li>\r\n</ul>', '<p>All IT students, professionals who have prior knowledge in Core Java can enroll.</p>', '<p>Students are employed in software companies as</p>\r\n\r\n<ul>\r\n	<li>Java/J2EE Developer</li>\r\n	<li>Java Programmer</li>\r\n	<li>Lead Java Developer</li>\r\n	<li>Software Engineer</li>\r\n	<li>Senior Software Engineer</li>\r\n	<li>Java Architect</li>\r\n	<li>Java Technical Architect</li>\r\n	<li>Senior Java Architect</li>\r\n	<li>Java Technical Manager</li>\r\n	<li>Java Development Manager</li>\r\n	<li>Java Project Manager</li>\r\n</ul>', 'images/courses/1556434591thumnail.png', 'images/courses/1537869246background.png', 'images/courses/1537869246referance.jpg', '48.00', '20000.00', 1, 0, '2018-09-25 03:54:06', '2019-10-15 16:23:30'),
(5, 6, 0, 'Microcontroller', '85', 'Microcontroller', 'microcontroller', 1, 'Learn how today\'s electronic devices/gadgets are designed, developed, and built as embedded systems that shape the world.', '<p>The course imparts a solid understanding of the Microcontrollers which plays a very important role in the design and development of Embedded systems. Embedded system is the combination of hardware and software to produce a complex system with high performance. Each day, our lives are becoming more dependent on embedded systems right from smart phones, air conditioners, cars and so on.</p>\r\n\r\n<p>The use of embedded systems is virtually limitless. So, the need for well -trained embedded systems engineers is an ever growing demand.</p>\r\n\r\n<p><strong>Course objective</strong></p>\r\n\r\n<p>The course is designed to equip the participants with the required skills both on the hardware as well as the software fronts. The training program enables the aspirants to work on the Architecture, Pin- diagram, Input/output interfacing, Exposure to embedded C and also to set up &amp; customize a microcontroller development environment. The course contents offered are revised in sync with the latest trends in the industry.</p>', '<ul>\r\n	<li>Embedded systems and it&#39;s applications</li>\r\n	<li>8051 Microcontroller-Hardware Architecture &amp; Embedded C programming</li>\r\n	<li>Timers, Interrupts and serial communication in 8051</li>\r\n	<li>Interfacing 8051 with LCD, Keypad, ADC</li>\r\n	<li>PIC 16F877A Microcontroller-Hardware Architecture &amp; GPIOs</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Timers, Interrupts and serial communication in PIC 16F877A</li>\r\n	<li>Interfacing PIC 16F877A with LCD, Keypad, ADC,UART communication</li>\r\n	<li>ARM 7TDMI-S Architecture &amp; ARM Operating modes</li>\r\n	<li>Introduction to LPC21xx and GPIO registers</li>\r\n	<li>Timers and Phase Locked loop(PLL) configuration</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Vectored Interrupt Controller(VIC) and serial Communication</li>\r\n	<li>Interfacing LPC21xx with LCD,Keypad,ADC,UART</li>\r\n	<li>Interfacing Wireless protocols- GSM,GPS,Bluetooth,RFID,Zigbee with LPC21xx</li>\r\n	<li>Hands-on development boards</li>\r\n</ul>', '<p>The course is available for professionals and B.E./B.Tech./ B.Sc or diploma students in ECE, EEE ,E&amp; I, or CS, IT engineering fields.</p>\r\n\r\n<p>Professionals looking to upscale your Career</p>', '<p>JOB OPPORTUNITIES</p>\r\n\r\n<ul>\r\n	<li>According to Hexa research,Embedded System Market Size Will Reach $214.24 Billion by 2020.</li>\r\n	<li>Companies like TCS, Wipro, L&amp;T, TATA, Elexsi, Infosys, Zensar, Tech Mahindra, Patni, Volvo, Airbus, Toshiba are investing heavily in their systems operations in India.</li>\r\n	<li>Lot of career opportunities are available in embedded systems. Some of them are as follows:\r\n	<ul>\r\n		<li>Embedded Software Engineer</li>\r\n		<li>System Software Engineer</li>\r\n		<li>Application Software Engineer</li>\r\n		<li>Software Test Engineer.</li>\r\n		<li>Embedded Hardware Engineer.</li>\r\n		<li>Embedded System Trainer.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Various Sectors in which you will get Embedded Systems Jobs are Medical Electronics, Aerospace, Automobiles, Defence, Toys, Consumer Electronics, Food industry, Telecommunication, Industrial machines, Space, Agriculture And Construction</li>\r\n</ul>', 'images/courses/1556434649thumnail.jpg', 'images/courses/1537937053background.jpg', 'images/courses/1537937053referance.jpg', '64.00', '20000.00', 0, 0, '2018-09-25 22:44:13', '2019-04-28 00:57:29'),
(6, 4, 0, 'PLC', '70', 'Programmable Logic Controller', 'plc', 1, 'Explore the simple yet highly efficient design solution to create complex logic in a much simpler way.', '<p>A Programmable Logic Controller (PLC) is an industrial computer control system that continuously monitors the state of input devices and makes decisions based upon a custom program to control the state of output devices.</p>\r\n\r\n<p>It is used primarily in automation of industrial electromechanical processes, such as control of machinery on factory assembly lines, amusement rides, or light fixtures. PLCs are designed for multiple arrangements of digital and analog inputs and outputs, extended temperature ranges, immunity to electrical noise, and resistance to vibration and impact. The hardware components of a PLC system are CPU, memory, input/output, power supply unit, and programming device.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"https://www.livewireindia.com/images/infographics/programmable_logic_controller.jpg\"><img alt=\"PLC\" src=\"https://www.livewireindia.com/images/infographics/programmable_logic_controller.jpg\" style=\"width:500px\" /></a></p>', '<ul>\r\n	<li>Architecture of PLC</li>\r\n	<li>Industrial Control &amp; Power Circuit</li>\r\n	<li>Working with Field Devices</li>\r\n	<li>PLC Programming using Ladder Logic &amp; Functional Block Diagram (FBD)</li>\r\n	<li>Interfacing I/O Devices with PLC</li>\r\n	<li>PC - PLC Communication</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Timer, Counter, Jump, Subroutine &amp; Multi-Interlocking</li>\r\n	<li>Advanced Math function , Comparator, Converter</li>\r\n	<li>Integer and Floating function, Shift &amp; Rotate function</li>\r\n	<li>Industrial Control system using PID controller</li>\r\n	<li>Industrial PLC Panel board wiring</li>\r\n	<li>Industrial Automation Project</li>\r\n</ul>', '<ul>\r\n	<li>BE/ BTech / BSc/ MSc/ Diploma Engineers of Electrical, Electronics &amp; communication, Instrumentation, Mechatronics branches</li>\r\n	<li>Working professionals from Maintenance, Projects, Quality, R &amp; D, Production, Design, Service, Application engineering.</li>\r\n	<li>ITI Electrical / Electronics Professionals with industry experience</li>\r\n	<li>IInd / IIIrd / Final year Engineering students looking for Summer / Winter / Industrial Training</li>\r\n	<li>Companies/Industries looking to meet Training Needs of their technical staff</li>\r\n</ul>', '<ul>\r\n	<li>Automation Engineer</li>\r\n	<li>PLC Program Developer</li>\r\n	<li>PLC operator</li>\r\n	<li>Field Area Control Engineer</li>\r\n	<li>Maintenance Engineer</li>\r\n	<li>Application Engineer</li>\r\n	<li>Panel Board wiring Engineer</li>\r\n</ul>', 'images/courses/1556434715thumnail.JPG', 'images/courses/1537937585background.jpg', 'images/courses/1537937585referance.jpg', '32.00', '15000.00', 0, 0, '2018-09-25 22:53:05', '2019-04-28 00:58:35'),
(7, 4, 0, 'SCADA', '65', 'Supervisory Control And Data Acquisition (SCADA)', 'scada', 1, 'Learn the powerful solution to Increase efficiency and maximize safety and profitability with SCADA.', '<p>Industrial automation is a set of technologies that results in operation of machines and systems without human intervention to a large extent. It enables factories to achieve performance superior to manual operation. Whereas &#39;control&#39; is another set of technologies that achieves desired patterns of variations of operational parameters and sequences for machines and systems by providing the input signals necessary.</p>\r\n\r\n<p>SCADA is a system of hardware and software that combines industrial automation and control. Short for Supervisory Control And Data Acquisition, SCADA are the backbone of modern industry. It allows industries to monitor, gather, and process data; interact with and control machines and devices such as valves, pumps, motors, and more, which are connected through HMI (human-machine interface) software, and record events into a log file.</p>\r\n\r\n<p><a href=\"https://www.livewireindia.com/images/infographics/scada_final.jpg\"><img alt=\"SCADA\" src=\"https://www.livewireindia.com/images/infographics/scada_final.jpg\" style=\"width:500px\" /></a></p>', '<ul>\r\n	<li>Architecture of SCADA</li>\r\n	<li>Different communication system</li>\r\n	<li>SCADA Window Creation</li>\r\n	<li>Object Configuration</li>\r\n	<li>VB Scripting</li>\r\n	<li>Alarm &amp; Recipe management</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>PLC &amp; SCADA Interfacing</li>\r\n	<li>Structures and Faceplates creation</li>\r\n	<li>Remote Monitor &amp; Control Process</li>\r\n	<li>Real Time trends &amp; Historical trends</li>\r\n	<li>Data logging, OPC &amp; ODBC</li>\r\n	<li>Industrial SCADA project</li>\r\n</ul>', '<ul>\r\n	<li>BE/ BTech / BSc/ MSc/ Diploma Engineers of Electrical, Electronics &amp; communication, Instrumentation, Mechatronics branches</li>\r\n	<li>Working professionals from Maintenance, Projects, Quality, R &amp; D, Production, Design, Service, Application engineering.</li>\r\n	<li>ITI Electrical / Electronics Professionals with industry experience</li>\r\n	<li>IInd / IIIrd / Final year Engineering students looking for Summer / Winter / Industrial Training</li>\r\n	<li>Companies/Industries looking to meet Training Needs of their technical staff</li>\r\n</ul>', '<ul>\r\n	<li>SCADA Operator</li>\r\n	<li>SCADA Programmer</li>\r\n	<li>Automation Engineer</li>\r\n	<li>SCADA Modelling Engineer</li>\r\n	<li>SCADA Maintenance Engineer and Instrumentation Engineer are some of the jobs available in this domain.</li>\r\n</ul>', 'images/courses/1556434807thumnail.jpg', 'images/courses/1537938062background.jpg', 'images/courses/1537938062referance.jpg', '32.00', '22000.00', 0, 0, '2018-09-25 23:01:02', '2019-04-28 01:00:07'),
(8, 1, 0, 'Cloud Computing', '15', 'Secure a sparkling career in cloud', 'cloud-computing', 1, 'Cloud Computing is the practice of using a network of remote service, which offers customers to work over the internet.', '<p>The cloud is just a metaphor for the Internet. It is simply about storing and accessing data and programs over the Internet. Cloud computing is an IT discipline growing in popularity.</p>\r\n\r\n<p>The subject deals with designing, building and implementing three types of cloud environments: public, private and hybrid. Cloud computing as a science is at the intersection of IT, information architecture, business, software engineering, and data storage.</p>\r\n\r\n<p>1.&nbsp;Resources Pooling<br />\r\n2.&nbsp;On-Demand Self-Service<br />\r\n3.&nbsp;Easy Maintenance<br />\r\n4.&nbsp;Large Network Access<br />\r\n5.&nbsp;Availability<br />\r\n6.&nbsp;Automatic System<br />\r\n7.&nbsp;Economical<br />\r\n8.&nbsp;Security<br />\r\n9.&nbsp;Pay as you go<br />\r\n10.Measured Service</p>', '<ul>\r\n	<li>Introduction to Cloud</li>\r\n	<li>Amazon EC2 and EBS</li>\r\n	<li>Amazon S3, RRS</li>\r\n	<li>Scaling and load distribution in AWS</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>AWS VPC, IAM</li>\r\n	<li>AWS Services and resources life cycle</li>\r\n	<li>AWS Architecture and Design</li>\r\n	<li>Cloud Migration and Implementation</li>\r\n</ul>', '<p>A Person who is highly desirable career goal for those seeking to fast-track their career in the Cloud computing industry.</p>\r\n\r\n<p>The following roles will benefit the most from this learning path:</p>\r\n\r\n<ul>\r\n	<li>Product Managers</li>\r\n	<li>Systems Administrators and IT Managers</li>\r\n	<li>IT Administrators and Operators</li>\r\n	<li>IT Engineers</li>\r\n	<li>Cloud Engineers</li>\r\n	<li>Developers</li>\r\n	<li>Software Architects</li>\r\n</ul>', '<ul>\r\n	<li>The median salary for IT professionals with cloud computing experience is $90,950.</li>\r\n	<li>According to Forbes, 3.9 million jobs are associated with cloud computing in IT.</li>\r\n	<li>There are 18,239,258 cloud computing jobs worldwide, 40.8% of which are located in China.</li>\r\n	<li>As an increasing number of enterprises adopt cloud computing, there will be a sharp slump in the demand for installation and maintenance engineers.</li>\r\n	<li>&ldquo;There is tremendous opportunity in cloud technology and we expect about 60 per cent of workload to shift on cloud in next 5-7 years,&quot; Infosys Vice President and Global Head Cloud Vishnu Bhat said.</li>\r\n	<li>Person with cloud computing skills can find employment with Microsoft, IBM, Amazon, Google, Hewlett Packard and many more. Even companies like VMware and Cloud Sigma provide employment to those professionals with cloud computing skills.</li>\r\n	<li>The job titles in the field of Cloud computing includes Cloud Architects, Cloud Developers and Cloud Security Specialists and so on.</li>\r\n	<li>Cloud computing skills are consistently listed among the top paying info-tech skills worldwide.</li>\r\n</ul>', 'images/courses/1556434316thumnail.png', 'images/courses/1537938611background.png', 'images/courses/1537938611referance.jpg', '40.00', '15000.00', 1, 0, '2018-09-25 23:10:11', '2019-10-15 16:17:13'),
(9, 1, 0, 'Network Engineering- Routing & Switching', '30', 'Routing & Switching', 'network-engineering--routing-&-switching', 1, 'Learn the core concepts of installation, configuration, troubleshooting routers and switches and more.', '<p>A computer network (LAN or WAN) operates by connecting computers and the peripherals (like printers and scanners) using two pieces of equipment: switches and routers. The switches enable the devices in a local network to talk to each other, while the routers enable the devices to connect with external networks.</p>\r\n\r\n<p>A switch acts as a controller - it manages how various devices within a local network share information among themselves. The router acts as a dispatcher - it chooses the best route for sending and receiving information across a local and an external network or Internet. Routing and switching functions are all about planning and fixing routers and switches in a network.</p>\r\n\r\n<p><strong>Course objective</strong></p>\r\n\r\n<p>The course teaches students the basics of networking and how to configure a small network with routers and switches. It teaches the difference between protocols like IP, TCP and UDP; between IPv4 and IPv6. It also teaches how to configure routers and switches in a network adhering to protocols. The course also covers many related subjects in LAN/WAN networking.</p>', '<ul>\r\n	<li>Network Fundamentals</li>\r\n	<li>IPv4 &amp; IPv6</li>\r\n	<li>Switching Technologies</li>\r\n	<li>Routing Technologies - EIGRP, OSPF, RIP</li>\r\n	<li>WAN Technologies</li>\r\n	<li>Infrastructure Services - DHCP, HSRP, NAT &amp; NTP</li>\r\n	<li>Infrastructure Security - ACL, Port Security, Telnet &amp; SSH</li>\r\n	<li>Infrastructure Management - SNMP, Syslog, Backup &amp; restore</li>\r\n</ul>', '<p>Anyone with basic computer skills can benefit from the course. Having a preliminary understanding of networks is desirable but not mandatory.</p>', '<p>There are plenty of job opportunities for students in the networking space. All organized sectors, right from corporates to small organizations using computer networks, need experts in routing and switching. Some of the popular job titles are: Networking Engineer, Networks Administrator, Network Architect, Network Manager, Networking Support Engineer, and Technical Specialist - Routing &amp; Switching.</p>', 'images/courses/1556434669thumnail.jpg', 'images/courses/1537938957background.jpg', 'images/courses/1537938957referance.jpg', '56.00', '15000.00', 0, 0, '2018-09-25 23:15:57', '2019-04-28 00:57:49'),
(10, 1, 0, 'Network Security', '35', 'Network Security', 'network-security', 1, 'Learn the core security concepts to install, monitor, and trouble shoot network security features to safeguard data and devices.', '<p>Network security is concerned with granting access to a network to the authorized users, and denying access to a network by the unauthorized users.</p>\r\n\r\n<p>It encompasses the actions to prevent attacks from viruses, worms, and Trojan horses; spyware and adware; zero-day/zero-hour attacks; hacker attacks; denial of service attacks; data interception and theft, and identity theft. A network security consists of many hardware and software components.</p>\r\n\r\n<p><a href=\"https://www.livewireindia.com/images/infographics/network-security_new.jpg\"><img alt=\"Network Security\" src=\"https://www.livewireindia.com/images/infographics/network-security_new.jpg\" style=\"width:500px\" /></a></p>', '<ul>\r\n	<li>Fundamentals of Network Security &amp; types of Security Threats</li>\r\n	<li>Securing Management Plane - AAA using ACS Server, RBAC</li>\r\n	<li>Firewall Technologies - Zone based firewall</li>\r\n	<li>Adaptive Security Appliance(ASA)</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>IPsec Site-to-site VPN and Remote Access VPN ‒ Clientless and AnyConnect VPN</li>\r\n	<li>Layer 2 attacks - Port Security, VLAN Security and Mitigation Procedures</li>\r\n	<li>Intrusion Prevention System Deployment</li>\r\n	<li>Email-based and Web based threats</li>\r\n</ul>', '<p>Network Engineering Routing &amp; Switching</p>', '<p>Major job providers for network security professionals are financial institutions and banks, internet service providers, pharmaceutical companies, government and defense agencies, and multinational corporations. Administrator - Network &amp; Security, Network Security Engineer, Technology Expert - Network Security, Network Security Analyst, Network Security Specialist, and Network Security Manager are some of the popular job openings in this domain.</p>', 'images/courses/1556434699thumnail.jpg', 'images/courses/1537939227background.png', 'images/courses/1537939227referance.jpg', '40.00', '20000.00', 0, 0, '2018-09-25 23:20:27', '2019-04-28 00:58:19'),
(11, 1, 0, 'BlockChain', '50', 'BLOCKCHAIN', 'blockchain', 1, 'The Blockchain is an Emerging technology that can create new opportunities for innovation.', '<p>The blockchain is a technology that permits digital information to be distributed but not copied. This technology is the backbone of the new age internet. Initially, it was designed for cryptocurrencies such as Bitcoin. But, now the tech community is finding a way to incorporate this technology into other spheres as well.</p>\r\n\r\n<p>Because Blockchain is incorruptible, many giant companies are also using Blockchain to provide the much-needed security to their customer&rsquo;s data. Companies of the financial sectors are using Blockchain more than any other sector. Thus, they are also opening up the opportunities for the youngsters who are proficient in Blockchain to get a job in their companies.</p>\r\n\r\n<p>Companies such as American Express, Oracle Corporation, Alibaba Group and many other big companies all over the world require Blockchain developers. So, if you want to join a company of such stature then you can enrol in our Blockchain course. After completing our course, you will be able to get a lucrative job in one of the biggest companies in the world for sure.</p>', '<ul>\r\n	<li>Blockchain and different applications in blockchain</li>\r\n	<li>Public and private blockchain</li>\r\n	<li>Ethereum Blockchain</li>\r\n	<li>Ethereum environment</li>\r\n	<li>Smart contracts for Solidity programming</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Writing real smart contract with Solidity</li>\r\n	<li>Hyperledger</li>\r\n	<li>Hyperledger Faric</li>\r\n	<li>Hyperledger environment</li>\r\n</ul>', '<p>There are no prerequisites as such for this Blockchain Course. However, development experience on an object-oriented language, and basic knowledge of command line &amp; Linux would be advantageous.</p>', '<ul>\r\n	<li>Blockchain startups and consortium</li>\r\n	<li>Large tech firms</li>\r\n	<li>Banks and other private sector firms</li>\r\n	<li>Government</li>\r\n	<li>Professional services firms</li>\r\n</ul>', 'images/courses/1556437181thumnail.jpeg', 'images/courses/1537940566background.jpg', 'images/courses/1537940566referance.jpg', '48.00', '20000.00', 1, 0, '2018-09-25 23:42:46', '2019-10-15 16:09:39'),
(12, 5, 0, 'Internet of Things (IoT)', '20', 'Internet of Things (IoT)', 'internet-of-things-(iot)', 1, 'The course imparts a sound understanding of the basic electronics, sensors, IoT architecture and communication protocols.', '<p>Internet of Things (IoT) is the concept of connecting any device to the Internet and to other connected devices. IoT platform uses Devices and objects with built-in sensors which integrates data from the different devices and performs analytics to distribute the most valuable information with applications. When devices/objects can represent themselves digitally, they can be controlled from anywhere.</p>\r\n\r\n<p>There are already more connected things than people in the world. Analyst Gartner calculates that around 8.4 billion IoT devices were in use in 2017, up 31 percent from 2016, and this will likely reach 20.4 billion by 2020.</p>\r\n\r\n<p><strong>Course Objective</strong></p>\r\n\r\n<p>The course imparts a sound understanding of the basic electronics, microcontroller architectures, sensors, IoT architecture and communication protocols. This course makes you understand the scope of the IoT, architecture of its networks, devices, programming, data, security and the rapidly evolving field of cloud computing and its relation to IoT.</p>', '<ul>\r\n	<li>Introduction to IoT ‐ Concepts and Technologies</li>\r\n	<li>Internet of Things Architecture</li>\r\n	<li>Device Design ‐ Sensors and Embedded Development Boards</li>\r\n	<li>Boards ‐ Arduino, Raspberry Pi, ESP8266</li>\r\n	<li>Communication with Bluetooth and WiFi modules</li>\r\n	<li>IoT Communication Protocols ‐ Wired, Wireless, Application, Transport Layer</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Cloud Architecture ‐ Services and Importance in IoT</li>\r\n	<li>Integration of IoT devices with cloud</li>\r\n	<li>Data, Storage and Security</li>\r\n	<li>Interfacing peripherals &amp; Programming GPIOs</li>\r\n	<li>Programming using Arduino and Python</li>\r\n</ul>', '<p>The course is available for professionals and graduates with basic knowledge of electronics and a good understanding of high-level programming concepts.</p>', '<ul>\r\n	<li>IOT Solutions Architect</li>\r\n	<li>IOT System Architect</li>\r\n	<li>IOT Architect</li>\r\n	<li>IOT Consultant ‐ Microcontroller/ Raspberry Pi</li>\r\n	<li>IOT Engineer</li>\r\n	<li>IoT Product Manager</li>\r\n	<li>IoT Embedded Principal Engineer</li>\r\n	<li>IoT Lead</li>\r\n	<li>Data Scientist ‐ IoT</li>\r\n	<li>Data Engineer ‐ Sensor and IoT</li>\r\n</ul>', 'images/courses/1556437232thumnail.jpg', 'images/courses/1537940805background.png', 'images/courses/1537940805referance.jpg', '48.00', '15000.00', 1, 0, '2018-09-25 23:46:45', '2019-07-25 05:15:13'),
(13, 1, 0, 'Data Science', '20', 'Data Science', 'data-science', 1, 'Data Science - a combination of skills, technologies, applications and processes used to drive Business planning.', '<p>Today&rsquo;s ambitious youngsters are concerned about their profession. They search out for numerous courses that satisfy their requirements. One such in a league is Data Science.</p>\r\n\r\n<p>Data Science is considered as a professional field that includes the process of extracting the knowledge using the data. There are lots of elements like computer science, mathematics, statistics and data analysis; all of them are meant for developing the models. The ideal models are meant for creating the processes, designing advanced systems and exploring the theories in a better way. Data Science has created a new world of opportunities and make you see the &lsquo;big picture&rsquo; of data.</p>\r\n\r\n<p>Discover your career as a Data Scientist!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"https://www.livewireindia.com/images/infographics/business-analytics_new.jpg\"><img alt=\"Data Science\" src=\"https://www.livewireindia.com/images/infographics/business-analytics_new.jpg\" /></a></p>', '<ul>\r\n	<li>Data Analytics &amp; its Methodology</li>\r\n	<li>Fundamental of statistics</li>\r\n	<li>Data Visualization</li>\r\n	<li>Data Distribution &amp; Correlation</li>\r\n	<li>Test of significance &ndash; Hypothesis testing, t-Test, ANOVA</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Data Mining &ndash; Unsupervised &amp; Supervised</li>\r\n	<li>Regression Analysis - Linear &amp; Logistic</li>\r\n	<li>Cluster Analysis &ndash; Hierarchical &amp; k-Means</li>\r\n	<li>Time series Analysis</li>\r\n	<li>Text Mining</li>\r\n</ul>', '<ul>\r\n	<li>A person with diplomas in an analytical concentration, such as Computer Science, Math &amp; Statistics, Management Information Systems, Economics, Engineering and Hard Sciences.</li>\r\n	<li>IT professionals and graduates who are looking for the career in data science and analytics.</li>\r\n	<li>Information Architects who want to gain expertise in Predictive Analytics Anyone who is familiar with the basic math and statistic concepts</li>\r\n	<li>A person who is curious about playing with data and Have passion for developing business acumen</li>\r\n</ul>', '<ul>\r\n	<li>Once can aim at becoming a Business Intelligence Analyst</li>\r\n	<li>SAS Data Analyst</li>\r\n	<li>IBM Data Analyst</li>\r\n	<li>Data Scientist</li>\r\n	<li>Data Mining Engineer</li>\r\n	<li>Machine Learning Engineer</li>\r\n	<li>Big Data Scientist</li>\r\n	<li>Data Architect</li>\r\n	<li>Business Intelligence Architect</li>\r\n	<li>Enterprise Data Architect</li>\r\n	<li>Big Data Architect</li>\r\n	<li>Hadoop Engineer</li>\r\n	<li>Data Warehouse Architect</li>\r\n	<li>Senior Data Scientist</li>\r\n	<li>Senior Big Data Analyst</li>\r\n</ul>\r\n\r\n<p>Highly talented, educated and experienced big data scientists can earn well over $250,000 per annum with salary plus incentives - Source : Indeed</p>\r\n\r\n<p>McKinsey predicts that by 2018, there will be a 50% gap in the supply of data scientists versus demand, which clearly means that the demand for data scientists and Business Analysts is increasing.</p>\r\n\r\n<p>A wide range of industries including marketing, finance, health care, logistics, insurance, e-commerce, manufacturing, and governments employ business analysts.</p>', 'images/courses/1571138141thumnail.png', 'images/courses/1537941080background.jpg', 'images/courses/1537941080referance.jpg', '40.00', '15000.00', 1, 0, '2018-09-25 23:51:21', '2019-10-15 18:15:41'),
(14, 2, 0, 'C Programming', '40', 'Learn C Programming', 'c-programming', 1, 'C Programming is mainly developed as a system programming language to write an operating system.', '<p>C is one of the foundations for modern information technology (IT) and computer science (CS).Many working principles of IT and CS, such as programming languages, computer architectures, operating systems, network communication, database, graphical user interface (GUI), graphics, image processing, parallel processing, multi-threads, real-time systems, device drivers, data acquisition, algorithms, numerical analysis, and computer game, are based on or reflected in the functionalities and features of C.</p>\r\n\r\n<p>C is the base for almost all popular programming languages.Because of the performance and portability of C, almost all popular cross-platform programming languages and scripting languages, such as C++, Java, Python, Objective-C, Perl, Ruby, PHP, Lua, and Bash, are implemented in C and borrows syntax and functions heavily from C.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Course objective</strong></p>\r\n\r\n<p>Students gain valuable knowledge of fundamental programming concepts such as data types, internal data representations, operators, expressions, loops for repetitions, control structures, arrays, input and output, functions, debugging, etc.</p>\r\n\r\n<p>Studying C provides a solid foundation for students who want to learn advanced programming skills such as object-oriented programming, event-driven programming, multi-thread programming, real-time programming, embedded programming, network programming, parallel programming, other programming languages, and new and emerging computing paradigms such as grid-computing and cloud computing.</p>', '<ul>\r\n	<li>C basics</li>\r\n	<li>Computing basics</li>\r\n	<li>Data type conversion</li>\r\n	<li>Functions</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Files and Streams</li>\r\n	<li>Memory Organization</li>\r\n	<li>Preprocessors</li>\r\n	<li>Gcc compiler and Make files</li>\r\n</ul>', '<p>All IT, software students, professionals and anybody interested in learning programming</p>', '<p>Job opportunities for C programmers include embedded engineers, Linux and unix programmers, android kernel development, Software developers, networking development engineer etc..</p>', 'images/courses/1571139922thumnail.jpg', 'images/courses/1537941942background.jpeg', 'images/courses/1537941942referance.jpg', '32.00', '15000.00', 1, 0, '2018-09-26 00:05:42', '2019-10-15 18:48:08'),
(15, 1, 0, 'LINUX System / Server', '25', 'LINUX System / Server', 'linux-system---server', 1, 'Learn to efficiently build and manage production Linux Infrastructure with Linux System / Server Administratio', '<p>Linux is an operating system like MS Windows, which allow software programs (&quot;application software&quot;) to interact with the computer. An operating system makes the computer hardware (say, a microprocessor) understand the commands of application software and gets the job done.</p>\r\n\r\n<p>Server/system administration of Linux is all about keeping a Linux-based computer in usable order. Administration involves functions like backing up files, installing new programs, creating or deleting user accounts, making certain that the filesystem is not corrupted, and so on. In short, if a computer were a house, system administration would be can be likened to maintenance - things like cleaning, fixing broken windows, etc.</p>\r\n\r\n<p><a href=\"https://www.livewireindia.com/images/infographics/Linux-OS_new.jpg\"><img alt=\"Linux\" src=\"https://www.livewireindia.com/images/infographics/Linux-OS_new.jpg\" style=\"width:500px\" /></a></p>', '<ul>\r\n	<li>Introduction and OS installation</li>\r\n	<li>Basic Commands</li>\r\n	<li>User &amp; Group management</li>\r\n	<li>File permissions &amp; ACL</li>\r\n	<li>Package &amp; Disk Management</li>\r\n	<li>Networking &amp; Remote installation</li>\r\n	<li>Kernel Virtualization</li>\r\n	<li>Linux process &amp; controlling services</li>\r\n	<li>SELinux and Firewalld</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Controlling boot process</li>\r\n	<li>Advance System Configuration and Management</li>\r\n	<li>Domain Name Service (DNS)</li>\r\n	<li>Web Service(HTTP) &amp; Mail Service(SMTP)</li>\r\n	<li>Centralized IP based storage</li>\r\n	<li>Network Storage(NFS &amp; smb)</li>\r\n	<li>MariaDB Databases</li>\r\n	<li>Linux Bash Scripting</li>\r\n	<li>Linux Containers &amp; Docker</li>\r\n</ul>', '<p>All Students are allowed</p>', '<p>Linux Administrator, Linux Cluster Admin, Linux Administrator - UNIX, System Administrator - Linux, and Linux Server Administrator are some of the hot jobs available for the students. IT, BPO, and consulting firms, and corporates running on Linux systems and servers are the major providers.</p>', 'images/courses/1556434611thumnail.png', 'images/courses/1537944826background.png', 'images/courses/1537944826referance.jpg', '64.00', '15000.00', 0, 0, '2018-09-26 00:53:46', '2019-04-28 00:56:51'),
(16, 1, 0, 'Windows Server Associate', '40', 'Windows Server Associate', 'windows-server-associate', 1, 'Learn to manage networks to become a highly in-demand professional in IT industry', '<p>Microsoft offers a wide range of online certification programs to validate the technical skills of IT professionals in managing its servers, desktops, applications, database, and application development.</p>\r\n\r\n<p>The Windows Server Associate tests the skills required to manage specific Windows Server operating system, client-server structure, network infrastructure, virtualization, etc. The Windows Server Associate certification is a mid-level certification and is a prerequisite to achieving Microsoft Certified Solutions Expert Certification.</p>\r\n\r\n<p><strong>Course objective</strong></p>\r\n\r\n<p>The course equips students to design and build technology solutions based on Windows Server technology. It provides students hands-on lab exercises in installing and configuring, administering Windows Server.</p>\r\n\r\n<p>It teaches students how to configure file and print services, deploy, manage, and maintain servers, and other subjects they need to learn thoroughly to crack the Windows Server Associate certification exam.</p>', '<ul>\r\n	<li>Installing and Configuring Windows Server</li>\r\n	<li>Administering Windows Server</li>\r\n	<li>Configuring Advanced Windows Server</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '<p>All IT students and professionals who are working or want to work in complex computing environments. The course and the MCSE certification will be useful for those who are currently employed as an information systems administrator, network technician or technical support specialist.</p>', '<p>Windows Server Associate-certified students get employed as Windows Server Administrator, System Administrator, Monitoring Operator, and Network Administrator.</p>', 'images/courses/1556434824thumnail.png', 'images/courses/1537945732background.jpg', 'images/courses/1537945732referance.jpg', '64.00', '15000.00', 0, 0, '2018-09-26 01:08:52', '2019-04-28 01:00:24'),
(17, 1, 0, 'Windows Server Engineer', '45', 'Windows Server Engineer', 'windows-server-engineer', 1, 'Become a Microsoft certified System engineer and gain the edge in the job market', '<p>Windows Server Expert is a globally recognised standard for IT professionals. Windows Server Expert credential holders are recognized industry-wide as possessing the technical skills, expertise and knowledge necessary to perform the Microsoft Windows NT operating system, related desktop systems, networking, and Microsoft&#39;s BackOffice server products.</p>\r\n\r\n<p>Windows Server Expert professionals are experts in solving problems requiring innovative resolutions, design systems and complex solutions, build and deploy, as well as operate, maintain and optimize Microsoft-based systems. Windows Server Expert comes in various certification flavors such as Server, Desktop, Applications, Database, and Developer.</p>\r\n\r\n<p><strong>Course objective</strong></p>\r\n\r\n<p>This course aims to teach students to understand the ever-changing technology environment of Microsoft products and technologies.</p>\r\n\r\n<p>It prepares students to obtain the Microsoft Certified Solutions Expert designation, a certification that endorses a student&#39;s ability to administer and configure computer infrastructure running on Microsoft servers.</p>', '<ul>\r\n	<li>Installing and Configuring Windows Server</li>\r\n	<li>Administering Windows Server</li>\r\n	<li>Configuring Advanced Windows Server</li>\r\n	<li>Designing and Implementing a Server Infrastructure</li>\r\n	<li>Implementing an Advanced Server Infrastructure</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '<p>All IT students and professionals who want to prove their ability to design, install, administer and troubleshoot desktop and networking infrastructure based on Microsoft server platforms.</p>', '<p>Analyst - Technical Support, Server Support Specialist, Technical Support Engineer, Windows Network Support Engineer, Desktop Support Engineer, System Administrators are some of the jobs available for students. Main job providers are software companies, and corporate houses.</p>', 'images/courses/1556434862thumnail.jpg', 'images/courses/1537947486background.jpg', 'images/courses/1537947318referance.jpg', '32.00', '15000.00', 0, 0, '2018-09-26 01:35:18', '2019-04-28 01:01:02'),
(18, 5, 0, 'Employment Proficiency Program', '10', 'Employment Proficiency Program', 'employment-proficiency-program', 1, 'The trainings aim at enhancing students’ personality and preparing them for group discussions, and job interviews.', '<p>The course trains students in key employability skills like communication, inter-personal relations, emotional intelligence, time management, and leadership qualities. It sensitizes the students with the expectations and realities of the world of work. The course helps students change their attitude for better and educates them to measure their progress in terms of behavioral outcomes.</p>\r\n\r\n<p>Surveys after surveys reveal the fact that a vast majority of arts &amp; science, and engineering graduates are not job-ready because they do not have employability skills. Since, organizations expect students to be job ready, students are required to learn the employability skills even as they pursue their formal or higher education.</p>', '<ul>\r\n	<li>&nbsp;Communication Skills and effective communication skill</li>\r\n	<li>&nbsp;Types of communication and Key communication skills</li>\r\n	<li>&nbsp;E-Mail Writing</li>\r\n	<li>&nbsp;Resume Writing</li>\r\n	<li>&nbsp;Presentation Skills</li>\r\n	<li>&nbsp;What is interview and different types of interviews</li>\r\n	<li>&nbsp;Preparation for personal interviews</li>\r\n	<li>&nbsp;Group Discussions</li>\r\n	<li>&nbsp;Telephonic interview</li>\r\n	<li>&nbsp;Overall Personality Development</li>\r\n</ul>', '<p>This course is designed keeping in mind the skill needs of polytechnic, college students of all streams and junior and middle level professionals. It&rsquo;s a must-study course for job seekers and students about to complete higher education.</p>', '<p>Having employability skills can help you get a job. They can also help you stay in a job and work your way to the top. If you score a job interview, chances are you&#39;ll be asked questions about your job-specific skills and your employability skills.</p>', 'images/courses/1556437200thumnail.jpg', 'images/courses/1553154262background.jpg', 'images/courses/1553154262referance.jpg', '40.00', '10000.00', 1, 0, '2019-03-21 07:44:22', '2019-10-23 17:09:45');
INSERT INTO `courses` (`id`, `category_id`, `parent_id`, `name`, `order`, `title`, `slug`, `hands_on`, `summary`, `about`, `learning`, `enroll`, `job_opp`, `thumnail`, `background`, `referance`, `duration`, `fee`, `status`, `special`, `created_at`, `updated_at`) VALUES
(19, 7, 28, 'Revit MEP', '3', 'Revit MEP', 'revit-mep', 1, 'Autodesk Revit MEP is a building information modeling (BIM) software created by Autodesk for professionals who engage in MEP engineering.', '<p>1. Work sharing<br />\r\n2. Link Revit<br />\r\n3. Controlling Visibility<br />\r\n4. Copy/Monitor<br />\r\n5. Link CAD<br />\r\n6. Mechanical Design<br />\r\n7. Space Modeling<br />\r\n8. Zones<br />\r\n9. Heating and Cooling Load Analysis<br />\r\n10. Mechanical Piping System<br />\r\n11. Electrical Design<br />\r\n12. Power and Communication<br />\r\n13. Creating Circuits<br />\r\n14. Creating Fire Alarm<br />\r\n15. Creating Power Distribution Systems</p>\r\n\r\n<p>&nbsp;</p>', NULL, '<p>1. Work sharing<br />\r\n2. Link Revit<br />\r\n3. Controlling Visibility<br />\r\n4. Copy/Monitor<br />\r\n5. Link CAD<br />\r\n6. Mechanical Design<br />\r\n7. Space Modeling<br />\r\n8. Zones<br />\r\n9. Heating and Cooling Load Analysis<br />\r\n10. Mechanical Piping System<br />\r\n11. Electrical Design<br />\r\n12. Power and Communication<br />\r\n13. Creating Circuits<br />\r\n14. Creating Fire Alarm<br />\r\n15. Creating Power Distribution Systems</p>', '<p>1. Work sharing<br />\r\n2. Link Revit<br />\r\n3. Controlling Visibility<br />\r\n4. Copy/Monitor<br />\r\n5. Link CAD<br />\r\n6. Mechanical Design<br />\r\n7. Space Modeling<br />\r\n8. Zones<br />\r\n9. Heating and Cooling Load Analysis<br />\r\n10. Mechanical Piping System<br />\r\n11. Electrical Design<br />\r\n12. Power and Communication<br />\r\n13. Creating Circuits<br />\r\n14. Creating Fire Alarm<br />\r\n15. Creating Power Distribution Systems</p>', 'images/courses/1575211792thumnail.png', 'images/courses/1564049899background.jpg', 'images/courses/1564049899referance.jpg', '60.00', '15100.00', 1, 0, '2019-07-25 04:18:19', '2019-12-01 21:49:52'),
(20, 7, 0, '3Ds MAX', '9', NULL, '3ds-max', 1, 'Autodesk 3ds Max, formerly 3D Studio and 3D Studio Max, is a professional 3D computer graphics program for making 3D animations..', '<p><strong>1. Modeling</strong></p>\r\n\r\n<ol>\r\n	<li>Create Building</li>\r\n	<li>Create Furniture</li>\r\n</ol>\r\n\r\n<p><strong>2. Material<br />\r\n3. Lighting</strong></p>\r\n\r\n<ol>\r\n	<li>Interior</li>\r\n	<li>Exterior</li>\r\n</ol>\r\n\r\n<p><strong>4. Camera</strong></p>\r\n\r\n<ol>\r\n	<li>Interior</li>\r\n	<li>Exterior</li>\r\n</ol>\r\n\r\n<p><strong>5. Rendering<br />\r\n6. Fog Effect<br />\r\n7. Fire Effect<br />\r\n8. Walkthrough Animation</strong></p>', NULL, NULL, NULL, 'images/courses/1571047385thumnail.jpg', NULL, NULL, '60.00', '15100.00', 1, 0, '2019-07-25 04:52:10', '2019-10-15 11:58:34'),
(21, 7, 0, 'AutoCAD-2D', '6', NULL, 'autocad-2d', 1, 'AutoCAD is a commercial computer-aided design (CAD) 2D drawing and drafting software application.', '<p>1. Draw Tools<br />\r\n2. Modify Tools<br />\r\n3. Drafting Tools<br />\r\n4. Layer Management<br />\r\n5. Dimension Manager<br />\r\n6. Dimensioning<br />\r\n7. More dimension editing tools<br />\r\n8. Text<br />\r\n9. Table<br />\r\n10. Leader<br />\r\n11. Inquiry tools<br />\r\n12. Measuring tools<br />\r\n13. Block<br />\r\n14. Slide creation &amp; running script<br />\r\n15. Creating OLE<br />\r\n16. External reference</p>', NULL, NULL, NULL, 'images/courses/1571045455thumnail.jpg', NULL, NULL, '60.00', '15100.00', 1, 0, '2019-07-25 05:09:53', '2019-10-24 13:56:02'),
(22, 1, 28, 'NavisWorks', '5', NULL, 'navisworks', 1, 'Navisworks is a 3D design review package for Microsoft Windows. Used primarily in construction industries to complement 3D design packages..', '<p>1. Measuring and Moving Objects<br />\r\n2. Selection and Search Sets<br />\r\n3. Viewpoints<br />\r\n4. Animations<br />\r\n5. Sectioning<br />\r\n6. Navisworks Real-Time Rendering<br />\r\n7. Time Liner<br />\r\n8. Import Tasks from External Project File<br />\r\n9. Time Liner Simulation<br />\r\n10. Simulation Export<br />\r\n11. Animator<br />\r\n12. Creating a Basic Animation<br />\r\n13. Quantification<br />\r\n14. Time Liner<br />\r\n15. Import Tasks from External Project File<br />\r\n16. Time Liner Simulation</p>', NULL, NULL, NULL, 'images/courses/1575211739thumnail.png', NULL, NULL, '24.00', '20100.00', 1, 0, '2019-07-25 05:14:03', '2019-12-01 21:50:56'),
(23, 7, 28, 'Revit Architecture', '2', NULL, 'revit-architecture', 1, 'Autodesk Revit is building information modelling software for architects, landscape architects, structural engineers, mechanical, electrical..', '<p>1. Working with Grids &amp; Levels<br />\r\n2. Floor &amp; Ceiling Plans<br />\r\n3. Roof<br />\r\n4. Stairs<br />\r\n5. Ramp<br />\r\n6. Railing<br />\r\n7. Elevations<br />\r\n8. Sections<br />\r\n9. 3D views<br />\r\n10.Interior &amp; Exterior<br />\r\n11.Area calculations<br />\r\n12.Schedules<br />\r\n13.Quantity Takeoffs (Estimating &amp; Costing)<br />\r\n14. Callout views<br />\r\n15. Legend Views<br />\r\n16. Massing &amp; Site Design</p>', NULL, NULL, NULL, 'images/courses/1575211658thumnail.png', NULL, NULL, '60.00', '15100.00', 1, 0, '2019-07-25 05:17:21', '2019-12-01 21:47:38'),
(24, 7, 0, 'SolidWorks', '8', NULL, 'solidworks', 1, 'SOLIDWORKS is a software tool that is used right from the conceptualization of the design until the final manufacturing of the product.', '<p>SolidWorks can help you convert your ideas into product designs quickly and effectively. As the world&#39;s leading tool in designing, it supports interactive learning of 3D modelling.</p>\r\n\r\n<p>1.&nbsp;3D sketching<br />\r\n2.&nbsp;Part modelling<br />\r\n3.&nbsp;Creating reference geometries<br />\r\n4.&nbsp;Editing features<br />\r\n5.&nbsp;Advanced modelling tools<br />\r\n6.&nbsp;Configuration<br />\r\n7.&nbsp;Design table/library features<br />\r\n8.&nbsp;Import/export of files<br />\r\n9.&nbsp;Surface overview<br />\r\n10.Bottom-up assembly<br />\r\n11.Top-down assembly<br />\r\n12.Exploding assemblies<br />\r\n13.Simulation/ Detailing<br />\r\n14.&nbsp;BOM, balloon tools<br />\r\n15.&nbsp;Sheet metal<br />\r\n16. PDM Works &amp; Weldment</p>', NULL, NULL, NULL, 'images/courses/1571119024thumnail.jpg', NULL, NULL, '60.00', '15100.00', 1, 0, '2019-10-15 12:53:29', '2019-12-01 16:28:15'),
(25, 5, 0, 'Digital Marketing', '7', NULL, 'digital-marketing', 1, 'Digital marketing is the use of  internet, mobile devices, social media, search engines, and other channels to reach consumers.', '<p>1.&nbsp;SEO (Search Engine Optimization)<br />\r\n2. Online Advertising&nbsp;<br />\r\n3. SMM ( Social Media Marketing)<br />\r\n4.&nbsp;Email Marketing<br />\r\n5.&nbsp;Affiliate&nbsp;Marketing<br />\r\n6. Content Marketing<br />\r\n7. Inbound Marketing<br />\r\n8.&nbsp;Online PR</p>', '<p>1.&nbsp;SEO (Search Engine Optimization)<br />\r\n2. Online Advertising&nbsp;<br />\r\n3. SMM ( Social Media Marketing)<br />\r\n4.&nbsp;Email Marketing<br />\r\n5.&nbsp;Affiliate&nbsp;Marketing</p>', NULL, NULL, 'images/courses/1571129547thumnail.png', 'images/courses/1572781671background.jpg', NULL, '40.00', '15100.00', 1, 1, '2019-10-15 15:52:27', '2019-11-03 18:47:51'),
(26, 1, 0, 'Python Training', '12', NULL, 'python', 1, 'Python is a powerful multi-purpose programming language created by Guido van Rossum.', '<p><strong>Python Programming Language:</strong></p>\r\n\r\n<p>It has simple easy-to-use syntax, making it the perfect language for someone trying to learn computer programming for the first time. This is a comprehensive guide on how to get started in Python.</p>\r\n\r\n<p><strong>Learning Objectives:</strong></p>\r\n\r\n<p>1.&nbsp;Understanding Python, Python Installation, Python Interface and python IDE<br />\r\n2.&nbsp;Understanding and working with Python Constructs.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; a. Jump/Branching</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; b. Loops</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;&nbsp;c. Functions</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;&nbsp;d. Variables and their scope</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;&nbsp;e. Modules</p>\r\n\r\n<p>&nbsp; &nbsp;&nbsp; &nbsp;f. Operators and expressions</p>\r\n\r\n<p>3.&nbsp;Importing/Exporting data in python<br />\r\n4.&nbsp;Exceptions Handling in python<br />\r\n5.&nbsp;Collections and dictionaries<br />\r\n6.&nbsp;Object oriented programming in python<br />\r\n7.&nbsp;Data Modelling using Machine Learning Techniques<br />\r\n8.&nbsp;Data Visualization</p>', NULL, NULL, NULL, 'images/courses/1571203593thumnail.jpg', NULL, NULL, '44.00', '15000.00', 1, 0, '2019-10-16 12:26:33', '2019-10-16 12:28:24'),
(27, 5, 0, 'Primavera', '9', NULL, 'primavera', 1, 'Primavera is extensive, elite, multi-task arranging and control program. It is perfect for venture focused commercial enterprises.', '<p><strong>Why should you learn?</strong></p>\r\n\r\n<p>Primavera tools can provide end-to-end, real time visibility of all corporate information, and helps managers determine correct resources and people with appropriate skills for all projects. With Primavera knowledge you can boost the enterprise agility, team productivity, portfolio predictability, and overall project management efficiently. To know about cost management and control, document management, schedule and resource management, fund management, project capital planning, project delivery management, facilities management and real estate management are some of the modules that would be covered in our courses.</p>', NULL, NULL, NULL, 'images/courses/1571206593thumnail.png', NULL, NULL, '40.00', '15000.00', 1, 0, '2019-10-16 13:16:33', '2019-10-16 13:17:03'),
(28, 7, 0, 'BIM Training', '1', NULL, 'bim', 1, 'BIM full form is Building Information Modeling which is digital representation of a Building.', '<p>BIM is an intelligent 3D model based process that gives Architecture, Engineering and Construction (AEC) professionals. The insight and tools to more efficiently plan, design construct &amp; manage building and infrastructure. Course Highlights are-</p>\r\n\r\n<ul>\r\n	<li>&nbsp; &nbsp; &nbsp; &nbsp; Model - Based estimation</li>\r\n	<li>&nbsp; &nbsp; &nbsp; &nbsp; Review the Model</li>\r\n	<li>&nbsp; &nbsp; &nbsp; &nbsp; Timeliner and Animator</li>\r\n	<li>&nbsp; &nbsp; &nbsp; &nbsp; Clash Detection</li>\r\n	<li>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;Preconstruction and Estimating</li>\r\n	<li>&nbsp; &nbsp; &nbsp; &nbsp; 5D Cost Planning Strategies in a Hard Bidv</li>\r\n	<li>&nbsp; &nbsp; &nbsp; &nbsp; Construction Cost Planning</li>\r\n</ul>', '<p>Mainly BIM use 5 types of software which is helps to minimize time for make a digital&nbsp;modeling.&nbsp;</p>\r\n\r\n<p>1.&nbsp;Revit Architecture<br />\r\n2. Revit Structure&nbsp;<br />\r\n3. Revit MEP<br />\r\n4.&nbsp;Navis Works<br />\r\n5. Project Management</p>', NULL, NULL, 'images/courses/1575192579thumnail.jpg', 'images/courses/1575192579background.jpg', NULL, '160.00', '55000.00', 1, 1, '2019-10-23 17:32:59', '2019-12-08 12:51:59'),
(29, 7, 28, 'Revit Structure', '4', NULL, 'revit-structure', 1, 'Revit Structure use 3D parametric design tools for creating, analyzing a project,\r\nand finish with construction documentation and design visualization.', '<p>1.&nbsp;Column<br />\r\n2.&nbsp;Beam<br />\r\n3.&nbsp;Foundation<br />\r\n4. Link CAD/ Revit<br />\r\n5.&nbsp;3D Reinforcement<br />\r\n6.&nbsp;Steel Connection<br />\r\n7.&nbsp;Scheduling<br />\r\n8.&nbsp;Costing</p>\r\n\r\n<p>9.&nbsp;Material Changing&nbsp;</p>\r\n\r\n<p>10.Stucture Steel Modeling</p>\r\n\r\n<p>11.Structural Documentation</p>\r\n\r\n<p>12.Analytical Mode</p>\r\n\r\n<p>13.Link IFC File</p>\r\n\r\n<p>14. Changing the Sketch Colour</p>\r\n\r\n<p>15. Visualisation</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, NULL, 'images/courses/1575211776thumnail.png', 'images/courses/1572781555background.jpg', NULL, '32.00', '15000.00', 1, 0, '2019-10-24 13:51:15', '2019-12-01 21:49:36');

