INSERT INTO `projects` (`id`, `project_type_id`, `brand_id`, `title`, `slug`, `introduction`, `provided`, `challanges_overcome`, `status`, `created_at`, `updated_at`) VALUES
(7, 3, 11, 'GTCL DR', 'gtcl-data-recovery-center', '<p><strong>Date Center Size:&nbsp;</strong>Server Room &amp; Power Room <strong>450sft</strong>(Approx.)</p>\r\n\r\n<p><strong>ECL Scope of works:</strong></p>\r\n\r\n<ul>\r\n	<li>Civil works including fire protected Epoxy Paint,Fire Rated Glass Doors</li>\r\n	<li>Ladder for Power &nbsp;Connectivity</li>\r\n	<li>Raised floor &amp; Pannel</li>\r\n	<li><strong>Electrical Infrastructure: </strong>Electrical cabling,MD Box,Circuit Breaker,Supply,Installation &amp; Commission of online UPS,AVR,SPD &amp; Generator including power management of DR.</li>\r\n	<li>Earthing System with installation for Data Center</li>\r\n	<li>Environment Monitoring System for Data Center</li>\r\n	<li>Supply,Installation &amp; Commission of&nbsp;Precision Air Conditioning &amp; Comfort Air Conditioning including Cooling management system.</li>\r\n	<li>Auto Fire Detection and Suppression System</li>\r\n	<li>Very Early Smoke Detection Apparatus (VESDA) for Data Center</li>\r\n	<li>Rodent System for pest controlling</li>\r\n	<li>Surveillance system for Data Center (IP Camera) Including Monitoring software</li>\r\n	<li>Access Control System for Datacenter Including Monitoring software</li>\r\n	<li>Rack mountable Server for Access Control &amp; IP Camera Monitoring</li>\r\n	<li>Two (02) Post Open Rack (42 Rack Unit)</li>\r\n	<li>Passive LAN Cabling</li>\r\n	<li>24/7 Support Service &amp; Maintenance</li>\r\n</ul>', NULL, NULL, 1, '2019-01-30 05:21:35', '2019-01-31 10:59:08'),
(8, 3, 10, 'EGCB DC', 'end-user-training', '<p><strong>Date Center Size:&nbsp;</strong>Server Room &amp; Power Room <strong>380sft</strong>(Approx.)</p>\r\n\r\n<p><strong>ECL Scope of works:</strong></p>\r\n\r\n<ul>\r\n	<li>Civil works including fire protected Epoxy Paint,Fire Rated Glass Doors</li>\r\n	<li>Ladder for Power &nbsp;Connectivity</li>\r\n	<li>Raised floor &amp; Pannel</li>\r\n	<li><strong>Electrical Infrastructure: </strong>Electrical cabling,MD Box,Circuit Breaker,Supply,Installation &amp; Commission of online UPS,AVR,SPD &amp; Generator including power management of DR.</li>\r\n	<li>Earthing System with installation for Data Center</li>\r\n	<li>Environment Monitoring System for Data Center</li>\r\n	<li>Supply,Installation &amp; Commission of&nbsp;Precision Air Conditioning &amp; Comfort Air Conditioning including Cooling management system.</li>\r\n	<li>Auto Fire Detection and Suppression System</li>\r\n	<li>Very Early Smoke Detection Apparatus (VESDA) for Data Center</li>\r\n	<li>Rodent System for pest controlling</li>\r\n	<li>Surveillance system for Data Center (IP Camera) Including Monitoring software</li>\r\n	<li>Access Control System for Datacenter Including Monitoring software</li>\r\n	<li>Rack mountable Server for Access Control &amp; IP Camera Monitoring</li>\r\n	<li>Cooling Containment &amp; Server Rack with IP KVM and Console</li>\r\n	<li>Passive LAN Cabling</li>\r\n	<li>24/7 Support Service &amp; Maintenance</li>\r\n</ul>', NULL, NULL, 1, '2019-01-30 05:24:27', '2019-01-31 10:59:21'),
(9, 4, 12, 'NWPGCL IP Survialance:', 'nwpgcl-ip-survialance:', '<p>We provided-</p>\r\n\r\n<ul>\r\n	<li>Optical Fiber Connectivity for long remote connectivity</li>\r\n	<li>Category 6 UTP Cable and Accessories</li>\r\n	<li>Layard Power Cable to Power Outlet</li>\r\n	<li>EarthLink ensure for each camera</li>\r\n	<li>Separate and dedicated Metallic Pole and Safety Equipment Box</li>\r\n	<li>4 Megapixel Pan-Tile-Zoom enabled Speed Dome IP Camera</li>\r\n	<li>Hi performance Gigabit Network Switch</li>\r\n	<li>Gigabit Media Converter for Single Camera Connectivity</li>\r\n	<li>Hi Performance Network Video Recorder</li>\r\n	<li>Competitively Price</li>\r\n	<li>24/7 Support Service &amp; Maintenance</li>\r\n</ul>', NULL, NULL, 1, '2019-01-31 11:18:55', '2019-01-31 11:18:55'),
(10, 5, 11, 'GTCL Infrastructure Integration', 'gtcl-infrastructure-integration', '<p>ECL Systems Provided:</p>\r\n\r\n<ul>\r\n	<li><strong>LAN:</strong>Local area connection of GTCL Head Office &amp; their 15 regional offices across Bangladesh.</li>\r\n	<li>\r\n	<p>&nbsp;<strong>Access Control:</strong> Supply, Installation &amp; Implementation of Biometric attendance systems for all GTCL&rsquo;s officials at their HQ &amp; 15 regional offices.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Network Analyzer:</strong> Supply, Installation &amp; Implementation of CISCO NetFlow for GTCL Network analyze.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>IT Equipments:</strong> Supply &amp; installation of 50Nos Printer &amp; 350Nos 1 KVA online UPS at GTCL Head Office &amp;&nbsp;15 regional offices.</p>\r\n	</li>\r\n</ul>', NULL, NULL, 1, '2019-01-31 12:16:51', '2019-01-31 12:16:51'),
(18, 6, 11, 'GTCL\'s Infrastructure Integration', 'gtcl\'s-infrastructure-integration', '<p>ECL Systems Provided:</p>\r\n\r\n<ul>\r\n	<li><strong>LAN:</strong>Local area connection of GTCL Head Office &amp; their 15 regional offices across Bangladesh.</li>\r\n	<li><strong>Access Control:</strong>&nbsp;Supply, Installation &amp; Implementation of Biometric attendance systems for all GTCL&rsquo;s officials at their HQ &amp; 15 regional offices.</li>\r\n	<li><strong>Network Analyzer:</strong>&nbsp;Supply, Installation &amp; Implementation of CISCO NetFlow for GTCL Network analyze.</li>\r\n	<li><strong>IT Equipments:</strong>&nbsp;Supply &amp; installation of 50Nos Printer &amp; 350Nos 1 KVA online UPS at GTCL Head Office &amp;&nbsp;15 regional offices.</li>\r\n</ul>', NULL, NULL, 1, '2019-01-31 12:45:03', '2019-01-31 12:45:03'),
(19, 7, 11, 'Training on CCNA & Red Hat Certified System Administrator', 'training-on-ccna-&-red-hat-certified-system-administration', '<p>ECL SYSTEMS LTD. conducted GTCL&#39;s 10 Officials CCNA &amp; RHCSA certification training.</p>\r\n\r\n<p><strong>Scope of work for training:</strong></p>\r\n\r\n<ul>\r\n	<li>Training on&nbsp;CISCO Certified Network Associate(CCNA) Routing &amp; Switching composite including theory &amp; laboratory works.Total 80 hours.</li>\r\n	<li>CCNA&nbsp;Routing &amp; Switching composite exam(200-125)</li>\r\n	<li>Training on Red Hat Enterprise Linux 7 version&nbsp;including theory &amp; laboratory works.Total 90 hours.</li>\r\n	<li>Red Hat Certified System Administrator(RHCSA) exam(EX200)</li>\r\n</ul>\r\n\r\n<ul>\r\n</ul>', '<p>&nbsp;</p>\r\n\r\n<ul>\r\n</ul>', NULL, 1, '2019-02-11 09:56:18', '2019-02-11 09:58:21'),
(20, 7, 11, 'PC Skill Training', 'pc-skill-training', '<p>ECL SYSTEMS LTD. conducted GTCL&#39;s 363 Officials PC Skill Training to operate &#39;SAP ERP&#39; at GTCL HQ &amp; 15 regional offices.</p>\r\n\r\n<p><strong>Scope of work for training:</strong></p>\r\n\r\n<ul>\r\n	<li>User training on Microsoft Outlook 2016</li>\r\n	<li>Microsoft Lync Basic 2013</li>\r\n	<li>Microsoft SharePoint 2016</li>\r\n	<li>Trouble Ticketing on&nbsp;SAP</li>\r\n	<li>Per Batch 12 Hours,Total 132 hours</li>\r\n	<li>Theory &amp; laboratory works</li>\r\n</ul>', NULL, NULL, 1, '2019-02-11 10:10:09', '2019-02-11 12:25:36'),
(21, 7, 10, 'Training & Certification on CDCP & CDCS', 'training-&-certification-on-cdcp-&-cdcs', '<p>ECL SYSTEMS LTD. conducted EGCB&#39;s 3 Officials <strong>CDCP &amp; CDCS</strong> certification training at EPI, Thailand.</p>\r\n\r\n<p><strong>Scope of work for training:</strong></p>\r\n\r\n<ul>\r\n	<li>Training on CDCP-Certified Data Centre Professional&nbsp;including theory &amp; laboratory works as per EPI Syllabus.</li>\r\n	<li>CDCP-Certified Data Centre Professional exam</li>\r\n	<li>Training on CDCS-Certified Data Centre Specialist including theory &amp; laboratory works as per EPI Syllabus.</li>\r\n	<li>CDCS-Certified Data Centre Specialist&nbsp; exam</li>\r\n</ul>', NULL, NULL, 1, '2019-02-11 10:22:28', '2019-02-11 10:22:28'),
(22, 6, 10, 'Supply of IT Equipments', 'supply-of-it-equipments', '<p>ECL Systems supplied &amp; installation of:</p>\r\n\r\n<ul>\r\n	<li>Blue Coat Band Width Manager</li>\r\n	<li>50pcs HP Desktop Computer</li>\r\n	<li>20pcs HP Laptop</li>\r\n	<li>04pcs&nbsp;Heavy Duty Laser Printer</li>\r\n	<li>10pcs Regular Printer &amp; Scanner</li>\r\n	<li>Projector</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, 1, '2019-02-11 12:20:52', '2019-02-11 12:23:57');

