(9, 'Training & Certification on CDCP & CDCS', '<p>We have conducted EGCB&#39;s 3 Officials&nbsp;<strong>CDCP &amp; CDCS</strong>&nbsp; &nbsp;certification training at Thailand associated with EPI with&nbsp;Certified Data Centre Professional exam.</p>', 'images/success-case/1570273655.png', '2019-10-05 18:07:35', '2019-10-05 18:08:01'),
